const initialState = [
  {
    id: 1,
    name: 'canceled'
  },
  {
    id: 2,
    name: 'draft'
  },
  {
    id: 3,
    name: 'with pickup'
  },
  {
    id: 4,
    name: 'printed'
  }
]
const storeReducer = () => {
  initialState.map((item, index) => {
    return (
      <label className="item" key={index}>
        <input type="checkbox" />
        <span>{item.name}</span>
      </label>
    )
  })
}

export default storeReducer;
